import React, { Component } from 'react';

class ListOfProjs extends Component {
	
	constructor(props) {
		super(props);
		
		this.createTask = this.createTask.bind(this);
	}
	
	doneTask(name, task) {
		this.props.doneElement(name, task);
	}
	
	createTask(proj) {
		return <li onClick={() => {this.doneTask(proj.proj_name, proj.proj_task)}} key={proj.proj_name}>{proj.proj_task}</li>
	}
	
	render() {
		let list = this.props.projs.map((proj) => {return(this.createTask(proj))});
		
		return(
			<ul>
				{list}
			</ul>
		);
	}
}

export default ListOfProjs;
